            var leftParsed = TryParse(leftChar, out (byte, byte)? cp300byteOfLeft);
            var rightParsed = TryParse(rightChar, out (byte, byte)? cp290byteOfRight);
            if (cp300byteOfLeft.HasValue)
            {
                if (cp290byteOfRight.HasValue)
                {
                    if(cp300byteOfLeft.Value.Item1 != cp290byteOfRight.Value.Item1) return cp300byteOfLeft.Value.Item1 - cp290byteOfRight.Value.Item1;
                    return cp300byteOfLeft.Value.Item2 - cp290byteOfRight.Value.Item2;
                }
                return 1;
            }

            if (rightParsed)
            {
                return -1;
            }

            return -1;

        }

